(function() {
    'use strict';

    angular
        .module('app')
        .controller('WorkOrderController', WorkOrderController);

    WorkOrderController.$inject = ['$scope', '$state', 'WorkOrder', 'ParseLinks', 'AlertService', 'paginationConstants', 'pagingParams'];

    function WorkOrderController ($scope, $state, WorkOrder, ParseLinks, AlertService, paginationConstants, pagingParams) {
        var vm = this;

        vm.loadPage = loadPage;
        vm.predicate = pagingParams.predicate;
        vm.reverse = pagingParams.ascending;
        vm.transition = transition;
        vm.itemsPerPage = paginationConstants.itemsPerPage;

        loadAll();

        function loadAll () {
            WorkOrder.query({
                page: pagingParams.page - 1,
                size: vm.itemsPerPage,
                sort: sort()
            }, onSuccess, onError);
            function sort() {
                var result = [vm.predicate + ',' + (vm.reverse ? 'asc' : 'desc')];
                if (vm.predicate !== 'id') {
                    result.push('id');
                }
                return result;
            }
            function onSuccess(data, headers) {
                vm.links = ParseLinks.parse(headers('link'));
                vm.totalItems = headers('X-Total-Count');
                vm.queryCount = vm.totalItems;
                vm.workOrders = data;
                vm.page = pagingParams.page;
            }
            function onError(error) {
                AlertService.error(error.data.message);
            }
        }

        function loadPage(page) {
            vm.page = page;
            vm.transition();
        }

        function transition() {
            $state.transitionTo($state.$current, {
                page: vm.page,
                sort: vm.predicate + ',' + (vm.reverse ? 'asc' : 'desc'),
                search: vm.currentSearch
            });
        }
    }
})();

(function() {
    'use strict';
    WorkOrderWithTrack.$inject = ["$resource", "DateUtils"];
    angular
        .module('app')
        .factory('WorkOrder', WorkOrder)
        .factory('WorkOrderWithTrack', WorkOrderWithTrack)
        .factory('WorkOrderByAsset', WorkOrderByAsset);

    WorkOrder.$inject = ['$resource', 'DateUtils'];
    WorkOrderByAsset.$inject = ['$resource', 'DateUtils'];

    function WorkOrderByAsset ($resource, DateUtils) {
        var resourceUrl = 'api/work-orders-by-asset/:id';
        return gerCRUD(resourceUrl, $resource, DateUtils);
    }

    function WorkOrder ($resource, DateUtils) {
        var resourceUrl =  'api/work-orders/:id';
        return gerCRUD(resourceUrl, $resource, DateUtils);
    }

    function WorkOrderWithTrack ($resource, DateUtils) {
        var resourceUrl =  'api/work-orders-with-track/:id';
        return gerCRUD(resourceUrl, $resource, DateUtils);
    }

    function gerCRUD(resourceUrl, $resource, DateUtils) {
        return $resource(resourceUrl, {}, {
            'query': { method: 'GET', isArray: true},
            'get': {
                method: 'GET',
                transformResponse: function (data) {
                    if (data) {
                        data = angular.fromJson(data);
                        data.trackDate = DateUtils.convertLocalDateFromServer(data.trackDate);
                    }
                    return data;
                }
            },
            'update': {
                method: 'PUT',
                transformRequest: function (data) {
                    var copy = angular.copy(data);
                    copy.trackDate = DateUtils.convertLocalDateToServer(copy.trackDate);
                    return angular.toJson(copy);
                }
            },
            'save': {
                method: 'POST',
                transformRequest: function (data) {
                    var copy = angular.copy(data);
                    copy.trackDate = DateUtils.convertLocalDateToServer(copy.trackDate);
                    return angular.toJson(copy);
                }
            }
        });
    }
})();

