angular.module('app').directive('assetsForm', function () {
    return {
        restrict: 'E',
        replace: true,
        templateUrl: 'app/dashboard/assets/directives/asset-form.tpl.html',
        scope: {
            asset: '=?asset',
            displayDetails: '=displayDetails',
            stepChange: '&',
            currentStep: '=?currentStep',
            parentStep: '=parentStep',
            parentId: '=parentId',
            isValidCallBack: '&',
            updateAssetCallback: '&?'
        },
        controller: ["$scope", "$filter", "$compile", "User", "UploadFile", "AssetManufacture", "AssetCapacityUnit", "AssetNames", "AssetLocations", "Upload", "AssetSpecificationType", "AssetSpecificationTypeFieldByType", "AssetSpecificationTypeValue", "AlertService", function ($scope, $filter, $compile, User, UploadFile, AssetManufacture, AssetCapacityUnit, AssetNames, AssetLocations, Upload, AssetSpecificationType, AssetSpecificationTypeFieldByType, AssetSpecificationTypeValue, AlertService) {

            if (angular.isUndefinedOrNull($scope.currentStep)) {
                $scope.currentStep = 1;
            }
            $scope.state = "A";
            $scope.disableForm = false;
            $scope.users = [];
            $scope.manufactures = [];
            $scope.capacityUnits = [];
            $scope.locations = [];
            $scope.names = [];
            $scope.scopeId = $scope.$id;
            $scope.assetSpecificationTypes = [];
            $scope.assetSpecificationTypeFields = [];
            $scope.assetSpecificationTypeValue = [];
            $scope.destroySpecTypeElement = false;
            $scope.assetSpecificationTypeSelect = true;
            $scope.forms = {};

            if ($scope.updateAssetCallback !== undefined) {
                var index = {index: $scope.currentStep};
                $scope.asset = $scope.updateAssetCallback(index);
                console.log($scope.asset);
            }

            loadAllAssetSpecificationTypes();
            loadAllManufactures();
            loadAllCapacityUnit();
            loadAllLocations();
            loadAllNames();
            loadAllUsers();

            addTypeFieldElements();
            loadAllAssetSpecificationTypeFields($scope.asset.assetSpecificationTypeId);
            $scope.changeToNewSpecType = function () {
                $scope.destroySpecTypeElement = true;
                $scope.assetSpecificationTypeSelect = false;
                $scope.assetSpecificationTypeValue = [];
                $scope.assetSpecificationTypeFields = [];
                $scope.destroySpecTypeElement = false;
                $scope.asset.assetSpecificationTypeId = null;
                addTypeFieldElements();
            };

            $scope.changeToSelectSpecType = function () {
                $scope.destroySpecTypeElement = false;
                $scope.assetSpecificationTypeSelect = true;
                loadAllAssetSpecificationTypeFields($scope.asset.assetSpecificationTypeId);
            };

            function loadAllAssetSpecificationTypeFields(assetSpecificationTypeId) {
                if (!angular.isUndefinedOrNull(assetSpecificationTypeId)) {

                    AssetSpecificationTypeFieldByType.query({id: assetSpecificationTypeId}, function (data) {
                        $scope.assetSpecificationTypeFields = data;
                        if (!angular.isUndefinedOrNull($scope.asset.id)) {
                            AssetSpecificationTypeValue.query({id: $scope.asset.id}, function (data) {
                                $scope.assetSpecificationTypeValue = data;
                                addTypeFieldElements();
                            }, onError);
                        }
                        else {
                            addTypeFieldElements();
                        }
                        // $scope.destroySpecTypeElement = true;

                    }, onError);
                }
            }

            function addTypeFieldElements() {
                var specTypeFormDir = document.querySelector(".asset-type-container" + $scope.scopeId);
                angular.element(specTypeFormDir).html("");
                // $scope.destroySpecTypeElement = false;
                angular.element(specTypeFormDir).append($compile("<asset-type-field-form asset=\"asset\" units=\"capacityUnits\" asset-type-fields=\"assetSpecificationTypeFields\" asset-type-values=\"assetSpecificationTypeValue\" disable-form=\"disableForm\" destroy-element=\"destroySpecTypeElement\"></asset-type-field-form>")($scope));
            }

            function loadAllAssetSpecificationTypes() {
                AssetSpecificationType.query({}, function (data) {
                    $scope.assetSpecificationTypes = data;
                }, onError);
            }

            function loadAllManufactures() {
                AssetManufacture.query({}, onSuccessManufacture, onError);
            }

            function loadAllCapacityUnit() {
                AssetCapacityUnit.query({}, onSuccessCapacityUnit, onError);
            }

            function loadAllNames() {
                AssetNames.query({}, function (data) {
                    $scope.names = data
                }, onError);
            }

            function loadAllLocations() {
                AssetLocations.query({}, function (data) {
                    $scope.locations = data
                }, onError);
            }

            function loadAllUsers() {
                User.query({}, onSuccess, onError);
            }


            function findAssetSpecificationTypeByFilter(field, value) {
                var example = {};
                example[field] = value;
                var assetSpecType = $filter('filter')($scope.assetSpecificationTypes, example, true);
                if (assetSpecType.length == 1) {
                    return assetSpecType;
                }
                return null;
            }

            function onSuccessManufacture(data) {
                $scope.manufactures = data;
            }

            function onSuccessCapacityUnit(data) {
                $scope.capacityUnits = data;
                console.log($scope.capacityUnits);
            }

            function onSuccess(data) {
                for (var i = 0; i < data.length; i++) {
                    if (angular.isUndefinedOrNull(data[i].firstName) && angular.isUndefinedOrNull(data[i].lastName)) {
                        data[i].name = data[i].login;
                    }
                    else {
                        data[i].name = data[i].firstName + ' ' + data[i].lastName;
                    }
                }
                $scope.users = data;
            }

            function onError(error) {
                AlertService.error(error.data.message);
            }

            $scope.assetSpecificationTypeIdChange = function () {
                $scope.asset.assetSpecificationTypeName = null;
                loadAllAssetSpecificationTypeFields($scope.asset.assetSpecificationTypeId);
            };

            if (!angular.isUndefinedOrNull($scope.displayDetails)) {
                $scope.disableForm = true;
            }

            $scope.hasSubTree = false;
            $scope.assetType = 'ASSET_GROUP';
            if (!angular.isUndefinedOrNull($scope.asset) && $scope.asset.assetType == null) {
                $scope.asset.assetType = 'ASSET_GROUP';
            }

            $scope.years = [];
            $scope.selectedYear = 0;
            var j = 0;
            for (var i = 1970; i <= new Date().getFullYear(); i++) {
                $scope.years.push(i);
                if ($scope.asset.year == i) {
                    $scope.selectedYear = j;
                }
                j++;
            }


            $scope.toggleAssetForm = function () {
                console.log($scope.asset.assetType);
                if ('ASSET_GROUP' == $scope.asset.assetType) {
                    $scope.hasSubTree = true;
                }
                else {
                    $scope.hasSubTree = false;
                }
            };

            $scope.$watch("asset", function (value) {
                $scope.toggleAssetForm();
            });
            $scope.$watch("hasNextStep", function (value) {
                if ($scope.stepChange) {
                    $scope.stepChange({"value": value});
                }
            });

            $scope.$watch("forms.assetImportWizardForm", function(val) {
                if (val) {
                    if ($scope.isValidCallBack && val != null) {
                        $scope.isValidCallBack({"valid": [val, $scope.currentStep]});
                    }
                }
            });

            if (!angular.isUndefinedOrNull($scope.asset.id)) {
                $scope.state = "E";
                if (!angular.isUndefinedOrNull($scope.asset.children)) {
                    $scope.hasSubTree = $scope.asset.children.length > 0;
                }
            }


            $scope.mapsDropzoneConfig = {
                'options': { // passed into the Dropzone constructor
                    'url': '/api/upload-files',
                    addRemoveLinks: function () {
                        this.createElement("<button class='btn btn-danger'><i class='fa fa-remove'></i>Remove file</button>");
                    }
                },
                acceptedFiles: "image/*,application/pdf",
                'eventHandlers': {
                    'success': function (file, response) {
                        if (!angular.isArray($scope.asset.maps)) {
                            $scope.asset.maps = [];
                        }
                        $scope.asset.maps.push(response);
                    }
                }
            };


            $scope.mapsDropzoneConfig.eventHandlers.removedfile = function (file) {
                if (file.status === "success") {
                    var data = JSON.parse(file.xhr.response);
                    $scope.deleteFromUploadedMapFiles(data.id);
                }
            };

            $scope.deleteFromUploadedMapFiles = function (id) {
                UploadFile.delete({id: id});
                $scope.deleteFromMapFiles(id);
            };

            $scope.deleteFromMapFiles = function (id) {
                $scope.asset.maps.forEach(function (item, index) {
                    if (item.id === id) {
                        $scope.asset.maps.splice(index, 1);
                    }
                });
            };

            $scope.otherDropzoneConfig = {
                'options': { // passed into the Dropzone constructor
                    'url': '/api/upload-files',
                    addRemoveLinks: function () {
                        this.createElement("<button class='btn btn-danger'><i class='fa fa-remove'></i>Remove file</button>");
                    }
                },
                'eventHandlers': {
                    'success': function (file, response) {
                        if (!angular.isArray($scope.asset.otherFiles)) {
                            $scope.asset.otherFiles = [];
                        }
                        $scope.asset.otherFiles.push(response);
                    }
                }
            };

            $scope.otherDropzoneConfig.eventHandlers.removedfile = function (file) {
                if (file.status === "success") {
                    var data = JSON.parse(file.xhr.response);
                    $scope.deleteFromUploadedOtherFiles(data.id);
                }
            };

            $scope.deleteFromUploadedOtherFiles = function (id) {
                UploadFile.delete({id: id});
                $scope.deleteFromOtherFiles(id);
            };

            $scope.deleteFromOtherFiles = function (id) {
                $scope.asset.otherFiles.forEach(function (item, index) {
                    if (item.id === id) {
                        $scope.asset.otherFiles.splice(index, 1);
                    }
                });
            };
        }],
        link: function (scope, rootScope, element, attrs, compile) {

        }
    }
})
    .directive('convertToString', function () {
        return {
            require: 'ngModel',
            link: function (scope, element, attrs, ngModel) {
                ngModel.$parsers.push(function (val) {
                    return '' + val;
                });
                ngModel.$formatters.push(function (val) {
                    return parseInt(val, 10);
                });
            }
        }
    })
    .directive('findFileName', function () {
        return {
            require: 'ngModel',
            link: function (scope, element, attrs, ngModel) {
                ngModel.$parsers.push(function (val) {
                    return '' + val;
                });
                ngModel.$formatters.push(function (val) {
                    return val.replace(/^.*[\\\/]/, '');
                });
            }
        }
    });

"use strict";

angular.module('app').directive('assetsImportWizardForm', function () {
    return {
        restrict: 'E',
        replace: true,
        templateUrl: 'app/dashboard/assets/directives/asset-import-wizard-form.tpl.html',
        scope: {
            'onSubmit': '&'
        },
        controller: ["$scope", "$compile", "$rootScope", "$element", function ($scope, $compile, $rootScope, $element) {
            $scope.wizardStepFormBranch = [];
            $scope.assetList = [];
            $scope.duplicate = false;
            $scope.selectTreeElement = "root";
            $scope.duplicatedAsset;
            if ($scope.duplicateAsset) {
                $scope.duplicate = true;
            }
            $scope.$watch('asset', function (value) {
                if (!angular.isUndefined(value)) {
                    $scope.duplicatedAsset = value;
                    $scope.wizardStepFormBranch = tree2line(value);
                    for (var i = 0; i < $scope.wizardStepFormBranch.length; i++) {
                        assetWizardStepAdd(i + 2, $scope.wizardStepFormBranch[i]);
                    }
                }
            });
            // var wizard = {};
            var vm = this;
            var wizard = angular.element($element[0].getElementsByClassName('asset-import-wizard'));
            var forms = [];
            $scope.assetImportData = [];
            $scope.branch;
            $scope.parentId = null;
            $scope.parentStep = null;
            $scope.assetId = null;
            $scope.assetImportData[0] = {"step": 1};
            $scope.selectedParentTree = function (branch) {
                var index = wizard.wizard('selectedItem');
                $scope.branch = branch;
                $scope.assetId = branch.demographicId;
                if ($scope.assetImportData.length < 2) {
                    $scope.assetImportData[0].data = {"assetId": $scope.assetId};
                    $scope.assetImportData[0].hasNext = true;
                    var index = 2;
                    assetWizardStepAdd(index);
                }
            };

            $scope.addStep = function (value) {
                if (value && !angular.isUndefined(value)) {
                    var index = $scope.assetImportData.length;
                    assetWizardStepAdd(index);
                }
                else if (angular.isUndefined(value)) {
                }
                else {
                    var index = wizard.wizard('selectedItem');
                    var indexToRemove = index.step + 1;
                    var howMany = $scope.assetImportData.length - index.step;
                    assetWizardStepRemove(indexToRemove, howMany);
                }
            };
            function assetWizardStepAdd(index) {
                assetWizardStepAdd(index, null);
            }

            function assetWizardStepAdd(index, branch) {
                $scope.assetImportData[index] = {
                    "step": index,
                    "hasNext": true,
                    "data": {"assetId": $scope.assetId}
                };
                $scope.assetList[index] = {};

                var pane;
                if (!angular.isObject(branch)) {
                    pane = $compile('<assets-form update-asset-callback="getAsset(index)" data-parent-id="' + $scope.branch.id + '" data-parent-step="' + $scope.parentStep + '" data-current-step="' + index + '" step-change="addStep(value)" is-valid-call-back="isFormValid(valid)"></assets-form>')($scope);
                }
                else {
                    $scope.parentId = branch.id;
                    var newIndex = index - 1;
                    pane = $compile('<assets-form update-asset-callback="getAsset(index)" data-parent-id="' + $scope.branch.id + '" data-parent-step="' + $scope.parentStep + '" data-current-step="' + index + '" step-change="addStep(value)" is-valid-call-back="isFormValid(valid)" asset="wizardStepFormBranch[' + newIndex + ']" ></assets-form>')($scope);
                }

                wizard.wizard('addSteps', index, [
                    {
                        badge: index,
                        label: '',
                        pane: pane
                    }
                ]);
                $scope.parentStep = index;
            }

            $scope.isFormValid = function (valid) {
                forms[valid[1]] = valid[0];
            }

            $scope.getAsset = function (index) {
                console.log("index return: " + index);
                if (!angular.isObject($scope.assetList[index])) {
                    $scope.assetList[index] = {
                        parentId: null,
                        name: null,
                        code: null,
                        assetType: null,
                        capacity: null,
                        manufacture: null,
                        strategic: "false",
                        supervisorId: null,
                        technicianId: null,
                        year: null,
                        id: null
                    };
                }
                return $scope.assetList[index];
            }

            function assetWizardStepRemove(index, howMany) {
                wizard.wizard('removeSteps', index, howMany);
                for (var i = 0; i < howMany - 1; i++) {
                    $scope.assetImportData.pop();
                }
            }

            function tree2line(branch) {
                var data = [];

                function recurse(current) {
                    data[data.length] = current;
                    if (Array.isArray(current.children)) {
                        for (var i = 0; i < current.children.length; i++) {
                            recurse(current.children[i]);
                        }
                    }
                }

                recurse(branch);
                return data;
            }

            wizard.on('finished.fu.wizard', function (evt, data) {
                evt.preventDefault();
                if (forms[forms.length - 1].$valid) {
                    evt.preventDefault();
                    console.log("Form finished");
                    $('.asset-import-form', $(evt.currentTarget)).triggerHandler('submit');
                }
            });


            wizard.on('changed.fu.wizard', function (evt, data) {
                if (data.step > 1 && data.direction === 'next' && !forms[data.step].$valid) {
                    console.log(forms[data.step]);
                    evt.preventDefault();
                }
            });
            wizard.on('actionclicked.fu.wizard', function (evt, data) {
                if (data.step > 1) {
                    console.log(forms[data.step]);
                    console.log("form step " +data.step + " validation is " + forms[data.step].$valid);
                }
                if (data.step > 1 && data.direction === 'next' && !forms[data.step].$valid) {
                    evt.preventDefault();
                }
            });

            $scope.wizard2CompleteCallback = function (wizardData) {

                var data = {parentId: $scope.branch.id, assetList: $scope.assetList};
                $scope.onSubmit({data: data});
                console.log(data);

                if ($scope.callbackWizardFinish) {
                    $scope.callbackWizardFinish(data);
                }
                $.smallBox({
                    title: $rootScope.getWord("Data submitted successfully!"),
                    content: "<i class='fa fa-clock-o'></i> <i>" + $rootScope.getWord('1 second ago') + "...</i>",
                    color: "#5F895F",
                    iconSmall: "fa fa-check bounce animated",
                    timeout: 4000
                });
                $scope.$destroy();
            }
        }],
        link: function (scope, rootScope, element, attrs) {

        }
    }
});

