                thisIQR,
                thisBoxSpotRadius,
                thisBoxLineColor,
                thisBoxFillColor,
                thisBoxWhisColor,
                thisBoxOutlineColor,
                thisBoxOutlineFill,
                thisBoxMedianColor,
                thisBoxTargetColor,
                thisBulletHeight,
                thisBulletWidth,
                thisBulletColor,
                thisBulletPerformanceColor,
                thisBulletRangeColors,
                thisDiscreteHeight,
                thisDiscreteWidth,
                thisDiscreteLineColor,
